import React, { useState } from "react";
import { collection, addDoc, getDocs, query, where } from "firebase/firestore";
import { auth, db } from "../init-firebase";
import Swal from "sweetalert2";
import { onAuthStateChanged, signOut } from "firebase/auth";
import { Helmet } from "react-helmet";

const HomePage = () => {
  const [name, setName] = useState("");
  const [age, setAge] = useState("");
  const [bloodGroup, setBloodGroup] = useState("");
  const [city, setCity] = useState("");
  const [ContactNo, setContactNo] = useState("");
  const [donors, setDonors] = useState([]);

  const DonateButton = async () => {
    if (!name || !bloodGroup || !city || !ContactNo || !age) {
      Swal.fire("Please fill in all the fields before donating blood.");
      return;
    }

    const user = auth.currentUser;
    if (!user) {
      Swal.fire("Please log in to donate blood.");
      return;
    }

    try {
      const donorQuery = query(
        collection(db, ""),
        where("Email", "==", user.email)
      );
      const donorSnapshot = await getDocs(donorQuery);

      if (!donorSnapshot.empty) {
        Swal.fire("You have already donated blood once.");
        return;
      }

      await addDoc(collection(db, "BloodDoners"), {
        DonerName: name,
        DonerBloodGroup: bloodGroup,
        CityName: city,
        ContactNo: ContactNo,
        Age: age,
        Email: user.email,
        DonationDate: new Date().toISOString()
      });

      Swal.fire(`Thank you ${name} for your blood donation!`);
      setName("");
      setBloodGroup("");
      setCity("");
      setContactNo("");
      setAge("");
    } catch (error) {
      console.error("Error donating blood:", error.message);
      Swal.fire("An error occurred while donating blood. Please try again.");
    }
  };

  const FindDoner = async () => {
    if (!bloodGroup || !city) {
      Swal.fire("Please enter Blood Group and City to find a donor.");
      return;
    }

    try {
      const donorQuery = query(
        collection(db, "BloodDonors"),
        where("DonerBloodGroup", "==", bloodGroup),
        where("CityName", "==", city)
      );
      const donorSnapshot = await getDocs(donorQuery);

      if (!donorSnapshot.empty) {
        const donorList = donorSnapshot.docs.map(doc => doc.data());
        setDonors(donorList);
      } else {
        Swal.fire("No donors found for the specified criteria.");
      }
    } catch (error) {
      console.error("Error finding donor:", error.message);
      Swal.fire("An error occurred while finding donors. Please try again.");
    }
  };

  const LogOut = async () => {
    try {
      await signOut(auth);
      Swal.fire("Successfully logged out.");
    } catch (error) {
      console.error("Error logging out:", error);
      Swal.fire("Error logging out. Please try again.");
    }
  };

  return (
    <div className="homepage">
      <Helmet>
        <title>HomePage</title>
      </Helmet>
      <div className="navbar">
        <div className="navbar-brand">Blood Bank</div>
        <div className="navbar-toggle" onClick="toggleNavbar()">
          <span></span>
          <span></span>
          <span></span>
        </div>
        <div className="navbar-links">
          <a href="/home">Home</a>
          <a href="/profile">Profile</a>
          <button >Logout</button>
          <a href="/doner">Doner's</a>
        </div>
      </div>

      <h1 className="title">Blood Bank</h1>
      <div className="form-container">
        <input
          type="text"
          placeholder="Enter Your Name"
          value={name}
          onChange={(e) => setName(e.target.value)}
        />
        <input
          type="number"
          placeholder="Enter Your Age"
          value={age}
          onChange={(e) => setAge(e.target.value)}
        />
        <input
          type="text"
          placeholder="Enter Blood Group"
          value={bloodGroup}
          onChange={(e) => setBloodGroup(e.target.value)}
        />
        <input
          type="text"
          placeholder="Enter City"
          value={city}
          onChange={(e) => setCity(e.target.value)}
        />
        <input
          type="text"
          placeholder="Enter Contact No"
          value={ContactNo}
          onChange={(e) => setContactNo(e.target.value)}
        />
        <div className="button-group">
          <button onClick={DonateButton} className="btn donate-btn">
            Donate Blood
          </button>
          <button onClick={FindDoner} className="btn find-btn">
            Find Donor
          </button>
        </div>
      </div>

      <div className="donor-list">
        <h2>Donor List</h2>
        {donors.length > 0 ? (
          donors.map((donor, index) => (
            <div key={index} className="donor-card">
              <p>
                <strong>Name:</strong> {donor.DonerName}
              </p>
              <p>
                <strong>Blood Group:</strong> {donor.DonerBloodGroup}
              </p>
              <p>
                <strong>City:</strong> {donor.CityName}
              </p>
              <p>
                <strong>Contact No:</strong> {donor.ContactNo}
              </p>
            </div>
          ))
        ) : (
          <p>No donors found</p>
        )}
      </div>

      <footer className="footer">
        <div className="footer-container">
          <p>&copy; {new Date().getFullYear()} Blood Bank | All Rights Reserved</p>
        </div>
      </footer>
    </div>
  );
};

export default HomePage;
